/* Module: Hero */
.m-Hero {
  position: absolute;
  top: calc(100vh - 3rem - 150px);
  left: 32px;
  width: 512px;
  color: black;
  z-index: 40;
  pointer-events: none;
  @media only screen and (min-width: $breakpoint-desk) {
    top: 20vh;
    left: 4vw;
  }

  &__title {
    margin-bottom: 32px;
    letter-spacing: 0.1em;
    font-size: 3rem;
    font-weight: 700;
  }

  &__seemore {
    display: inline-block;
    position: relative;
    padding: 0;
    background-color: transparent;
    color: black;
    font-family: inherit;
    font-weight: inherit;
    font-size: inherit;
    border: none;
    outline: none;
    opacity: 1;
    visibility: visible;
    transition: opacity, visibility;
    transition-duration: 0.3s;
    transition-timing-function: ease-in-out;
    pointer-events: all;
    cursor: pointer;
    &--disable {
      opacity: 0;
      visibility: hidden;
    }
    &:after {
      content: '';
      position: absolute;
      bottom: -6px;
      right: 0;
      width: 30%;
      height: 2px;
      background-color: black;
      transition: transform 0.3s cubic-bezier(0.075, 0.82, 0.165, 1);
    }
    &:hover:after {
      transform: translateX(-100%);
    }
  }

  &__popup {
    display: flex;
    align-items: center;
    justify-content: center;
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    color: white;
    background-color: black;
    text-align: center;
    z-index: 13;
    opacity: 0;
    visibility: hidden;
    pointer-events: none;
    transition: opacity, visibility;
    transition-duration: 0.3s;
    transition-timing-function: ease-in-out;
    &--active {
      opacity: 1;
      visibility: visible;
      pointer-events: all;
    }
    &__desc {
      width: auto;
      padding-left: 16px;
      padding-right: 16px;
      line-height: 1.5em;
      letter-spacing: 0.1em;
      @media only screen and (min-width: $breakpoint-desk) {
        width: 50vw;
      }
    }
    &__close {
      position: absolute;
      top: 32px;
      right: 32px;
      width: 32px;
      height: 32px;
      padding: 0;
      background-color: transparent;
      color: white;
      border: none;
      outline: none;
      cursor: pointer;
      img {
        width: 100%;
        height: auto;
      }
    }
  }
}

